import React from "react";

const TableRow = props => {
  return (
    <tr>
      <th scope="row">{props.id}</th>
      <td>
        <image src={props.image} alt="Failed to load" />
      </td>
      <td>{props.title}</td>
      <td>{props.price}</td>
      <td>{props.quantity}</td>
    </tr>
  );
};

export default TableRow;
